        <Container>
        
            <h1>Hi Listerians,</h1>
            <h1>Find and Touch with Listerians </h1>
            <h1>that perfectly fits your needs</h1>
        
        <SearchField1 />
    
        
        </Container>
    )
}

export default HomeText
const SearchField1=styled(SearchField)`
justify-content:space-between;


`
